import React from 'react';
import Top from '../Top/Top';
import Bottom from '../Bottom/Bottom';
import Img1 from '../images/복리후생.png';
import Img2 from '../images/복리후생2.png';
import styles from './Aboutaone.module.css';

import PopUp from '../component/PopUp'
<script type="text/javascript" src="//dapi.kakao.com/v2/maps/sdk.js?appkey=발급받은 APP KEY"></script>

const Aboutaone11 = () => {
    return (
    <div>
       
            <Top />
            <div className={styles.down}>오시는길</div>
            <div class = "container">
           <h2> 오시는길</h2>
           <PopUp />
            <img src ={Img1} alt='복리후생' /> 
            <img src ={Img2} alt='복리후생2' /> 
            </div>
            <Bottom />
        </div>
    );
};

export default Aboutaone11;
